(268, '2013-10-01 20:08:55', '', '132.216.94.221', 'delete', 'demo1_product_lines', 'Classic Cars', '', 'a:4:{s:12:"product_line";s:12:"Classic Cars";s:16:"text_description";s:735:"Attention car enthusiasts: Make your wildest car ownership dreams come true. Whether you are looking for classic muscle cars, dream sports cars or movie-inspired miniatures, you will find great choices in this category. These replicas feature superb attention to detail and craftsmanship and offer features such as working steering system, opening forward compartment, opening rear trunk with removable spare wheel, 4-wheel independent spring suspension, and so on. The models range in size from 1:10 to 1:24 scale and include numerous limited edition and several out-of-production vehicles. All models include a certificate of authenticity from their manufacturers and come fully assembled and ready for display in the home or office.";s:16:"html_description";s:755:"<p><b>Attention car enthusiasts:</b> Make your wildest car ownership dreams come true. Whether you are looking for classic muscle cars, dream sports cars or movie-inspired miniatures, you will find great choices in this category. These replicas feature superb attention to detail and craftsmanship and offer features such as working steering system, opening forward compartment, opening rear trunk with removable spare wheel, 4-wheel independent spring suspension, and so on. The models range in size from 1:10 to 1:24 scale and include numerous limited edition and several out-of-production vehicles. <br><br>All models include a certificate of authenticity from their manufacturers and come fully assembled and ready for display in the home /office.</p>";s:5:"image";s:8135:"data:image/jpeg;base64,";}', '', 0),
