(2297, '2015-07-23 17:00:03', '', '151.77.89.155', 'delete', 'demo1_tinymce', '27', '', 'a:3:{s:2:"id";s:2:"27";s:18:"body_html_header_1";s:2233:"കെനിയയിലെ പരിസ്ഥിതിപ്രവർത്തകയും രാഷ്ട്രീയ സന്നദ്ധപ്രവർത്തകയുമായിരുന്നു വങ്കാരി മുത മാതായ് എന്ന വങ്കാരി മാതായ്. വൃക്ഷത്തൈ നട്ടുപിടിപ്പിക്കൽ വലിയ പ്രസ്ഥാനമായി വളർത്തിയെടുത്ത വങ്കാരിയ്ക്കാണ് ആഫ്രിക്കയിൽ നിന്നും സമാധാനത്തിനുള്ള നോബൽ സമ്മാനം ആദ്യമായി ലഭിച്ചത്. പ്രസിഡന്റ് കിബാക്കിയുടെ മന്ത്രിസഭയിൽ പരിസ്ഥിതി വകുപ്പിൽ സഹമന്ത്രിയായി മാതായ് സേവനമനുഷ്ഠിച്ചിട്ടുണ്ട്. ഭാരതത്തിൽ നിന്നും ഇന്ദിരാ ഗാന്ധി പുരസ്കാരം ഉൾപ്പടെ നിരവധി പുരസ്കാരങ്ങൾക്ക് വങ്കാരി മാതായ് അർഹയായി. കോളനിവാഴ്ച അവസാനിച്ചുകൊണ്ടിരിക്കുന്ന ആഫ്രിക്കയിലെ പുതിയ തലമുറയ്ക്ക് വിദ്യാഭ്യാസം നൽകുന്നതിനു വേണ്ടി, അമേരിക്കൻ സെനറ്ററായിരുന്ന ജോൺ എഫ്.കെന്നഡിയുടെ നേതൃത്വത്തിൽ ഒരു പദ്ധതി തുടങ്ങിയിരുന്നു. മനുഷ്യാവകാശ പ്രവർത്തക, ജനാധിപത്യപോരാളി, അഴിമതിവിരുദ്ധപ്രചാരക, സ്ത്രീപക്ഷവാദി, രാഷ്ട്രീയ നേതാവ്, പരിസ്ഥിതി പ്രവർത്തക എന്നീനിലകളിലും ഇവർ ശ്രദ്ധേയയായിരുന്നു.";s:18:"body_html_header_2";s:1654:"കോളനിയായിരുന്ന കെനിയയിലെ ന്യേരി പട്ടണത്തിൽ 1940 ഏപ്രിൽ 1 നാണ് വങ്കാരി മാത്തായ് ജനിച്ചത്. കെനിയയിലെ ഏറ്റവും ജനസംഖ്യയുള്ള പരമ്പരാഗത ഗോത്രമായ കിക്കുയു വംശത്തിലാണ് വങ്കാരിയുടെ ജനനം. 1943 ൽ പിതാവിന്റെ ജോലിയുമായി ബന്ധപ്പെട്ട് വങ്കാരിയുടെ കുടുംബം റിഫ്റ്റ് വാലിയിലേക്ക് കുടിയേറി താമസം തുടങ്ങി.പിതാവ് ജോലി ചെയ്തിരുന്നിടത്ത്, വിദ്യാഭ്യാസത്തിനുള്ള സൗകര്യമില്ലാതിരുന്നതിനാൽ അവർ മാതാവിന്റേയും രണ്ടു സഹോദരങ്ങളുടേയും ഒപ്പം തിരികെ ഗ്രാമത്തിലേക്കു പോന്നു. പിതാവ്, കൃഷിത്തോട്ടത്തിലെ പണിയുമായി അവിടെ തന്നെ തുടർന്നു.എട്ടാമത്തെ വയസ്സിൽ സഹോദരങ്ങളുടെയൊപ്പം പ്രാഥമിക വിദ്യാഭ്യാസത്തിനായി ഇഹീത്തെയിലുള്ള വിദ്യാലയത്തിൽ ചേർന്നു.";}', '', 0),
